import React from 'react';
import logo from './logo.svg';
import './App.css';
import HomeBody from './homepage';
import MovieList from './movies';

function Nav() {
  return (
    <div>
      <img src="frontend\public\4746048.png" height="400" />
      <h1> Joel Hilton Movie Site</h1>
    </div>
  );
}

function App() {
  return (
    <div>
      <Nav />
      <HomeBody />
      <MovieList />
    </div>
  );
}

export default App;
